  false,\n\t\"url\": null,\n\t\"notes\": \"CTD, bottle, and other data were collected
  in the Arctic, North Atlantic, and Pacific Oceans from the TELEOST and other platforms
  from 01 August 1960 to 22 April 2000. CTD data include temperature and salinity
  profiles. Bottle data include concentration profiles of silicate, phosphate, nitrate,
  nitrite, and ammonia. Data were submitted by the Marine Environmental Data Service
  (MEDS) of Canada and are in the MEDS ASCII format.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
